// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.28;

contract WelfareSignup {
    struct Event {
        string name;
        string description;
        address creator;
        uint16 maxCapacity;  // Changed to uint16 for smaller max capacity
        uint256 signupStartTime;
        uint256 signupEndTime;
        uint256 redemptionEndTime;  // Kept as uint256
        uint8 attendeeCount;  // Changed to uint8
        bool isActive;  // Added active flag
    }

    Event public eventDetails;
    mapping(address => bool) public attendees;
    mapping(address => bool) public redeemed;  // Track if an attendee has redeemed their reward

    event SignedUp(address indexed attendee);
    event EventCreated(
        string name,
        uint16 maxCapacity,
        uint256 signupStartTime,
        uint256 signupEndTime,
        uint256 redemptionEndTime  // Added redemptionEndTime to event creation event
    );
    event Redeemed(address indexed attendee);
    event Deactivated(address indexed creator);

    modifier onlyCreator() {
        require(msg.sender == eventDetails.creator, "Only the creator can perform this action");
        _;
    }

    constructor(
        string memory _name,
        string memory _description,
        uint16 _maxCapacity,
        uint256 _signupStartTime,
        uint256 _signupEndTime,
        uint256 _redemptionEndTime
    ) {
        require(_maxCapacity > 0, "Capacity must be greater than 0");
        require(_signupStartTime < _signupEndTime, "Signup start time must be before signup end time");
        require(_signupEndTime < _redemptionEndTime, "Signup end time must be before redemption end time");

        eventDetails = Event({
            name: _name,
            description: _description,
            maxCapacity: _maxCapacity,
            signupStartTime: _signupStartTime,
            signupEndTime: _signupEndTime,
            redemptionEndTime: _redemptionEndTime,
            creator: msg.sender,
            attendeeCount: 0,
            isActive: true
        });

        emit EventCreated(_name, _maxCapacity, _signupStartTime, _signupEndTime, _redemptionEndTime);
    }

    function signUp() external {
        require(eventDetails.isActive, "Event is not active");
        require(block.timestamp >= eventDetails.signupStartTime, "Signup has not started yet");
        require(block.timestamp < eventDetails.signupEndTime, "Signup has ended");
        require(eventDetails.attendeeCount < eventDetails.maxCapacity, "Event is full");
        require(!attendees[msg.sender], "Already signed up");

        attendees[msg.sender] = true;
        eventDetails.attendeeCount++;
        emit SignedUp(msg.sender);
    }

    function redeem() external {
        require(eventDetails.isActive, "Event is not active");
        require(block.timestamp < eventDetails.redemptionEndTime, "Redemption time has ended");
        require(attendees[msg.sender], "You are not signed up for the event");
        require(!redeemed[msg.sender], "You have already redeemed your reward");

        redeemed[msg.sender] = true;
        emit Redeemed(msg.sender);
    }

    function deactivate() external onlyCreator {
        eventDetails.isActive = false;
        emit Deactivated(msg.sender);
    }
}

